import React, { componentDidMount,Component } from 'react'
import { connect } from 'react-redux'
import axios from 'axios'
import * as ReactBoostrap from 'react-bootstrap';

export default class BorrarAgendaServicio extends Component
{
  constructor()
  {
    super();
    this.state = {
      serviciosAgendados: [],
      agendaBorrado: {},
      agendaBorradoId: 0,
    }
  }
  componentDidMount = () => {
    axios.get('http://localhost:9090/servicioAgendado/listar').then((resp) => {
        this.setState({
          serviciosAgendados: resp.data,              
        });
    }).catch((error) => {
        console.log(error);
    }
    )
  };  
  render()
  {

    return (
      <div>
       
          <h1>Borrar Servicios</h1>
            <ReactBoostrap.Table  hover variant="light-dark">
            <table className="table ">
            <thead>
            <th scope="col">Id</th >
            <th scope="col">Estado</th>
            <th scope="col">Fecha Elegida</th>
            <th scope="col">Fecha Registro</th>
            <th scope="col">Id Servicio</th>          
          </thead>
          <tbody>
            {
              this.state.serviciosAgendados.map(elemento => (
                <tr key={elemento.id} value={elemento} id={elemento.id}>
                  <td>{elemento.id}</td>
                  <td>{elemento.estado}</td>
                  <td>{elemento.fechaElegida.substring(0, [10])}</td>
                  <td>{elemento.fechaRegistro.substring(0, [10])}</td>
                  <td>{elemento.servicio.id}</td>
                  <td>
                    <ButtonGroup>
                      <Button className="button" onClick={this.irTareas.bind(this, elemento.id)}>Ver tareas</Button>
                    </ButtonGroup>
                  </td>
                </tr>

              ))}          
          </tbody>
              </table>
          </ReactBoostrap.Table>
          
        
      </div>
    )
  }
}
